Building a query starts with either the query function: authors().bind(&client, Some("Greece")); or the generated parameter struct: AuthorsParams { country: Some("Greece")
}.bind(&client); The query function is useful when you have a few obvious parameters, while the parameter struct is more explicit. If you want even more clarity, you can mix both styles: authors().params(&client, AuthorsParams { country: Some("Greece")
}); Note Queries that don't have a return value (insertions, for example) don't generate a query object. Instead, when calling bind or params they execute and return the number of rows affected.

