Query objects have a map method that allows them to transform the query's returned rows without requiring intermediate allocation: enum Country { Greece, TheRest
} impl<'a> From<&'a str> for Country { fn from(s: &'a str) -> Self { if s == "Greece" { Self::Greece } else { Self::TheRest } }
} struct CustomAuthor { full_name: String, age: usize, country: String
} all_authors() .bind(&client, Some("Greece")) .map(|author| { let full_name = format!( "{}, {}", author.last_name.to_uppercase(), author.first_name ); CustomAuthor { full_name:, age: author.age, country: author.country.into() } }); The result of a map is another query object.

