Once the query has been built, use one of the following methods to select the expected number of rows. opt: one or zero rows (error otherwise). one: exactly one row (error otherwise). iter: iterator of zero or more rows. all: like iter, but collects the rows in a Vec. Here are some examples: author_by_id().bind(&client, &0).opt().await?;
author_by_id().bind(&client, &0).one().await?; // Error if this author id doesn't exist
select_42().bind(&client).one().await?;
all_authors().bind(&client).all().await?;
iter_authors().bind(&client).iter().await?.collect::<Vec<_>>(); Note If your queries are sync, you don't need to .await them.
